import React from 'react';
import style from './form.module.css';

function Form({ id }) {
  const [comment, setComment] = React.useState('');
  return (
    <form className={style.photo}>
      <textarea
        value={comment}
        onChange={({ target }) => setComment(target.value)}
      />
    </form>
  );
}

export default Form;
